import { useDispatch, useSelector } from "react-redux"
import { useState } from "react";
import { WITH_DIPOSED_MONAY, WITH_DROW_MONAY } from "./rtk/slice/bank";
function App(){
const [state,setstate]=useState(0)
const reduser=useSelector(state=>state.bank)
const dispatch=useDispatch()

return(
<div className="App">
<p>{reduser}</p>
<input onChange={(e)=>setstate(e.target.value)} type="text"placeholder="Monay"></input>
<button onClick={()=>dispatch(WITH_DROW_MONAY(100))}>WITHDORW_MANY</button>
<button onClick={()=>dispatch(WITH_DIPOSED_MONAY(state*1))}>DIPOSED_MONAY</button>

</div>
)
}
export default App
